const test = require('tape');
const looksSame = require('looks-same');
const base64Img = require('base64-img');


require('../../../src/ImageSequencer.js');

const sequencer = ImageSequencer({ ui: false });
const target = 'test_outputs';

var image = 'data:image/png;base64,';
var importedImage = 'data:image/png;base64,',
  benchmark = 'data:image/png;base64,';

//Tests for Mask module

test('Load invert module', function(t) {
  sequencer.loadImages( image);
  t.equal(sequencer.steps.length, 1, 'Image loaded');
  sequencer.addSteps('import-image', { url: importedImage });
  t.equal(sequencer.steps[1].options.name, 'import-image', 'Image imported for masking');
  sequencer.addSteps('mask', { offset: -2, resize: '145%' });
  t.equal(sequencer.steps[2].options.name, 'mask', 'Alpha Masking step added');
  t.end();
});

test('Mask module produces correct output', function(t) {
  sequencer.run(function(out) {
    var result = sequencer.steps[2].output.src;
    base64Img.imgSync(result, target, 'result');
    base64Img.imgSync(benchmark, target, 'benchmark');
    result = './test_outputs/result.png';
    benchmark = './test_outputs/benchmark.png';
    looksSame(result, benchmark, function(err, res) {
      if (err) console.log(err);
      t.equal(res.equal, true);
      t.end();
    });
  });
});